import { AppConfig } from '@/constants/config'
export default {
  name: 'StCopyright',
  serviceInject() {
    return {
      appConfig: AppConfig
    }
  },
  computed: {
    yearRange() {
      const { GIT_DATE } = this.appConfig
      const date = Math.max(+new Date(GIT_DATE), +new Date())
      return `2015-${new Date(date).getFullYear()}`
    }
  }
}
